import useFetch from "./useFetch";

const Project = ({id}) => {

    const { data, isPending, error } = useFetch(`http://127.0.0.1:5000/projects/${id}`)

    return ( 
        <div className="home">

        <p>{id}</p>

        </div>
     );
  
}
 
export default Project;
